import React from "react";

function Navbar({ children }) {
  return (
    <div>
      <nav className="navbar navbar-expand navbar-light bg-light">
        <ul className="nav navbar-nav">
          <li className="nav-item ">
            <a className="nav-link" href="#">
              Naruto Shippuden
            </a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="#">
              Dragon Ball Super
            </a>
          </li>
        </ul>
      </nav>
      {children}
    </div>
  );
}

export default Navbar;
